import Header from '../styles/Header';
import NavBar from '../components/NavBar';

const StarHop = () => {
  return (
    <div>
      <Header />
      <AdSense.Google
        client="ca-pub-6513320241703770"
        slot="9365940470"
        style={{ width: 920, height: 90, float: 'top' }}
      />
      <div>Star Hop map and controls here</div>
    </div>
  );
};

export default StarHop;
